function Change_inputSDR(inputSDR_idx, clicked_id){
	
	active_inputSDR_idx = inputSDR_idx;
	
	var myTable = document.getElementById('errtable1');
	//myTable.rows[4].cells[4].innerHTML = clicked_id;
	
	
	if (clicked_SDR_id == 0) { // initialization
		clicked_id = "7dB";
		clicked_SDR_id = "7dB"
		active_inputSDR_idx = 3; 
	}
	var old_clicked = document.getElementById(clicked_SDR_id);
	old_clicked.setAttribute('class', '');
	var new_clicked = document.getElementById(clicked_id)
	new_clicked.setAttribute('class', 'clicked')
	clicked_SDR_id = clicked_id;
	

	var snd;
	var alg;
	
	for (alg = 0; alg < 18; alg++) {
		for (snd = 0; snd < 10; snd++) {
			if (inputSDRs[active_inputSDR_idx] < 10) {
				if (alg == 0) {
					myTable.rows[alg+2].cells[snd+1].setAttribute('data-file', 'sounds/'+algorithms[alg]+'/'+sounds[snd]+'_0'+inputSDRs[active_inputSDR_idx].toString()+'.wav'); //clipped
				} else {
					myTable.rows[alg+2].cells[snd+1].setAttribute('data-file', 'sounds/'+algorithms[alg]+'/'+sounds[snd]+'_rec_'+algorithms[alg]+'_'+'0'+inputSDRs[active_inputSDR_idx].toString()+'.wav');				
				}	
			} else {
				if (alg == 0) {
					myTable.rows[alg+2].cells[snd+1].setAttribute('data-file', 'sounds/'+algorithms[alg]+'/'+sounds[snd]+'_'+inputSDRs[active_inputSDR_idx].toString()+'.wav'); // clipped
				} else {
					myTable.rows[alg+2].cells[snd+1].setAttribute('data-file', 'sounds/'+algorithms[alg]+'/'+sounds[snd]+'_rec_'+algorithms[alg]+'_'+inputSDRs[active_inputSDR_idx].toString()+'.wav');				
				}
			}
		}
	}
	
	Change_values(active_value, clicked_value_id);
	Change_titles();

}


function Change_values(value, clicked_id) {
	
	active_value = value;
	
	
	if (clicked_value_id == 0) {
		clicked_id = "none";
		clicked_value_id = "none"
	}
	var old_clicked = document.getElementById(clicked_value_id);
	old_clicked.setAttribute('class', '');
	var new_clicked = document.getElementById(clicked_id)
	new_clicked.setAttribute('class', 'clicked')
	clicked_value_id = clicked_id;
	
	var myTable = document.getElementById('errtable1');

	var snd;
	var alg;
	
	
	if (value == 1) { // dSDR_clipped
		for (alg = 0; alg < 18; alg++) {
			for (snd = 0; snd < 10; snd++) {
				myTable.rows[alg+2].cells[snd+1].innerHTML = (dSDR_clipped[alg][snd][active_inputSDR_idx].toFixed(2)).toString().replace('-','&minus;');
				//myTable.rows[alg+2].cells[snd+1].style.textAlign = 'right';
				myTable.rows[alg+2].cells[snd+1].setAttribute('class', 'clickable clickable_right');
				//myTable.rows[alg+2].cells[snd+1].setAttribute('title', sounds[snd].substring(4)+' '+algorithms[alg]+' '+inputSDRs[active_inputSDR_idx].toString() )
			}
		}
	} else if (value == 2) { // PEAQ
		for (alg = 0; alg < 18; alg++) {
			for (snd = 0; snd < 10; snd++) {
				myTable.rows[alg+2].cells[snd+1].innerHTML = (PEAQ[alg][snd][active_inputSDR_idx].toFixed(2)).toString().replace('-','&minus;');
				//myTable.rows[alg+2].cells[snd+1].style.textAlign = 'right';
				myTable.rows[alg+2].cells[snd+1].setAttribute('class', 'clickable clickable_right');
			}
		}
	} else if (value == 3) { //PEMO-Q 
		for (alg = 0; alg < 18; alg++) {
			for (snd = 0; snd < 10; snd++) {
				myTable.rows[alg+2].cells[snd+1].innerHTML = (PEMO_Q[alg][snd][active_inputSDR_idx].toFixed(2)).toString().replace('-','&minus;');
				//myTable.rows[alg+2].cells[snd+1].style.textAlign = 'right';
				myTable.rows[alg+2].cells[snd+1].setAttribute('class', 'clickable clickable_right');
			}
		}
	} else { // blind, X on all positions
		for (alg = 0; alg < 18; alg++) {
			for (snd = 0; snd < 10; snd++) {
				myTable.rows[alg+2].cells[snd+1].innerHTML = 'X';
				//myTable.rows[alg+2].cells[snd+1].style.textAlign = 'center';
				myTable.rows[alg+2].cells[snd+1].setAttribute('class', 'clickable');
			}
		}
	}
	
}

function Change_titles() {
	
	var myTable = document.getElementById('errtable1');
	
	for (alg = 0; alg < 19; alg++) {
		for (snd = 0; snd < 10; snd++) {
			if (alg == 0) {
				myTable.rows[alg+1].cells[snd+1].setAttribute('title', sounds_label[snd]+' Original '+inputSDRs[active_inputSDR_idx].toString()+' dB' );
			} else {
				myTable.rows[alg+1].cells[snd+1].setAttribute('title', sounds_label[snd]+' '+algorithms_label[alg]+' '+inputSDRs[active_inputSDR_idx].toString()+' dB' );
			}				
		}
	}
	
	
}

